import React from 'react';

const NutritionComparison = (props) =>{
    console.log("NutritionComparison",props)
    return(
        <div className="nutrition-comparison">
            <p>See the the nutrient comparison below</p>
            //add arrow

            <div className="compare-wrapper">
                <div className="comparisons">
                    <NutritionList data={props.data.kibble}/>
                    <NutritionList data={props.data.recipe} showImg={true}/>
                </div>
                <p className="padding-bottom-large">Learn about <a href="#">the role of protein, fat, and carbs</a> in a dog's diet.</p>
                <p className="padding-bottom-large">* All units above are given in grams per 1000 calories (g/kcal).</p>
            </div>

        </div>
    )
}

const NutritionList = (props) =>{
    return(
        <div className="nutrition-list">
            {props.showImg? <img src="https://www.nomnomnow.com/images/logo_utensils.svg" alt=""/> : <div/>}
            <p className="name">{props.data.name}</p>
            <h2>Protein</h2>
            <p>{props.data.protein}</p>
            <h2>Fat</h2>
            <p>{props.data.fat}</p>
            <h2>Carbohydrate</h2>
            <p>{props.data.carbs}</p>
        </div>
    )
}


export default NutritionComparison;
